import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// Components
import PageTitle from '../components/PageTitle';
import Items from '../components/views/Items';
import Filters from '../components/FiltersContext';
// Utils
import { upgrades, upgradesGen, upgradesFilters } from '../utils/items/upgrades';

const styles = theme => ({
  root: {
    width: '100%',
  },
  wrapper: {
    maxWidth: 1020,
    margin: 'auto',
  },
});

function Upgrades(props) {
  const { classes } = props;
  const pagetitle = 'Upgrades';

  return (
    <div className={classes.root}>
      <PageTitle pagetitle={pagetitle} />
      <div className={classes.wrapper}>
        <Items data={upgrades} dataGeneral={upgradesGen} />
      </div>
    </div>
  );

}

Upgrades.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Upgrades);
